// src/components/Dashboard.js
import { Container, Typography } from '@mui/material';
import { useAuth } from '../context/AuthContext';

const Dashboard = () => {
  const { logout } = useAuth();

  return (
    <Container component="main" maxWidth="xs">
      <Typography variant="h4" style={{ margin: '20px 0', textAlign: 'center' }}>Welcome to the Dashboard</Typography>
      <Typography variant="button" color="primary" onClick={logout} style={{ cursor: 'pointer' }}>Logout</Typography>
    </Container>
  );
};

export default Dashboard;
